import React from 'react';
import { Button } from 'reactstrap';
import 'react-toastify/dist/ReactToastify.css';
import useCopy from "@react-hook/copy";
import { useTranslation } from 'react-i18next';
import Swal from 'sweetalert2';

export interface ICopyParticipantLinkButtonInActiveCall{
    participantLink: string,
    buttonIcon: string
}

const CopyParticipantLinkButtonInActiveCall : React.FC<ICopyParticipantLinkButtonInActiveCall> = ({participantLink, buttonIcon}) => {
    const { copy } = useCopy(participantLink);
    const { t } = useTranslation();
    return(
        <>
            <Button
            type="button"
            color="none"
            onClick={() => {
            copy();
            Swal.fire({
                position: "top-start",
                icon: "success",
                title: t("Copied to clipboard a participant invite!"),
                showConfirmButton: false,
                timer: 1500,
                customClass: {
                  popup: "swal-mini-popup",
                },
                backdrop: false
            });
            }}
            className="nav-btn user-profile-show"
            style={{
                color: "white",
            }}
            >
            <i className={buttonIcon}></i>
            </Button>
        </>
    )
}

export default CopyParticipantLinkButtonInActiveCall;
